// src/components/PrivateRoutes.jsx
import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const PrivateRoutes = () => {
  const { user } = useAuth(); // Get user from AuthContext

  return user ? (
    <Outlet />
  ) : (
    <Navigate to="/login" /> // Redirect to login if not authenticated
  );
};

const AdminRoute = ({ children }) => {
  const { user } = useAuth(); // Get user from AuthContext
  
  if (!user) {
    return <Navigate to="/login" />; // Redirect to login if not authenticated
  }

  if (user.coordinator.coor_role !== 'Admin') {
    return <Navigate to="/dashboard" />; // Redirect to dashboard if not admin
  }

  return children; // Render children if admin
};

// Export both components
export { PrivateRoutes, AdminRoute };
